        <ul>
          {pokemons.map(({ name }) => (
            <li key={name}>{name}</li>
          ))}
          {pokemons.map(({ created }) => (
            <li key={created}>{created}</li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default App;
